window.bookSummaryJSON = "<p>Madison Myers is a hard-working assistant to one of LA's top talent agents. Determined to make a respectable name for herself in the business, the last thing she wants in her life is singing sensation Walker Rhodes, with his nonstop tabloid-filled antics and bad boy behavior. But after he pulls her onstage during one of his concerts and serenades her in front of thousands of screaming fans, all bets are off. She doesn't want to give in to his charms, but Walker is relentless and keeping a secret of his own. A secret that changes everything between them. </p> <p>Come fall in love with Walker and Madison in <i>Seeing Stars</i>. </p>"; 
